import React from 'react';

export const Header = () => {
  return (
    <header className="flex bg-black">
      <span class="text-yellow-500"> STAR WARS</span>
      <svg
        alt="star wars logo"
        src="../../assets/seeklogo.svg"
        width="200px"
        height="100px"
      />
      <img
        alt="star wars logo"
        src="/home/martin/Escritorio/Programacion/lambdachallenge/src/assets/star-wars-logo.png"
        width="200px"
        height="100px"
      />
    </header>
  );
};
